    //     password: matkhau,
    //     }))
    }
    return(
        <form onSubmit={handle}>
            <input type="text" value={login}
            onChange={e=>setlogin(e.target.value)} />
            <br></br>
            <input type="password" value={matkhau} 
            onChange={e=>setmatkhau(e.target.value)}/>
            <br></br>
            <button >dang nhap</button>

        </form>
    )
}
